import React from "react";
import '../Assets/Styles/InformationComponentStyles.css'
import MeCardComponent from "./MeCardComponent";
import MenuComponent from "./MenuComponent";

function InformationComponent(props){
    return(
        <div className="information-container">
            <MeCardComponent></MeCardComponent>
            <MenuComponent setSelectedPage={props.setSelectedPage}></MenuComponent>
        </div>
    );
}

export default InformationComponent;
